import React from 'react';
import Link from 'next/link';

const NavBar = () => {
  return (
    <div className='bg-gray-500 py-4'>
      <Link href='/sobre'>
        Sobre
      </Link>
      <Link href='/cadastrese'>
        Cadastre-se
      </Link>
      <Link href='/cadastrese'>
        Entrar
      </Link>
    </div>
  )
}

export default NavBar;
